import { makeStyles } from '@mui/core'
import React from 'react'
const useStyles = makeStyles({
    page:{
        background:'#f9f9f9',
        with: '100%'
    }
}) 

export default function Layout({children}) {
    const classes = useStyles();
  return (
    <div>
        <div className={classes.page}>
            {children}
        </div>
    </div>
  )
}
